Publisher: K. A. Shott | March 5, 2010 | ISBN: N/A | PDF | 197 pages 

The Murder of Vincent van Gogh There is one incontrovertible fact, Vincent van Gogh (the famous and infamous 19th century painter) was shot and died. Was Vincent van Gogh murdered? That question can only be answered with logical supposition: when it is impossible to prove the truth or untruth of a thing then truth matters little. Therefore, what is known as the truth could be a lie and, contrary-wise, what is believed a lie may prove Truth. Let us begin this tale where all good murders begin: a body. Not Vincent van GoghÃƒÂ¢
